import { useEffect, useState } from 'react';
import { GoogleLogout, GoogleLogin } from 'react-google-login';
import { useHistory, useLocation } from 'react-router-dom';
import { useDispatch } from 'react-redux';

const Header = (props) => {
    const history = useHistory();
    const dispatch = useDispatch();
    const location = useLocation();
    const [user, setUser] = useState(JSON.parse(localStorage.getItem('profile')));

    useEffect(() => {
        const token = user?.token;

        // Check for web toker

        setUser(JSON.parse(localStorage.getItem('profile')));
    }, [location])

    const gSuccess = (response) => {
        const result = response?.profileObj;
    }
    
    const gFailure = (error) => {
        console.log(error);
    }

    const logout = () => {
        dispatch({ type: 'LOGOUT' });
        history.push('/');
        setUser(null);
    }

    return (
    <div className="m-10 flex place-content-between">
        <div className="flex font-bold text-4xl text-[#F4D47E]">
            SPEED TYPER V2
        </div>
        <div className="flex bg-[#F4D47E] rounded-xl px-4 text-center">
            <div className="flex flex-col justify-center">
                <GoogleLogin 
                clientId='615805703985-gg79j05v75914bn07ein1fu87dno6rof.apps.googleusercontent.com'
                onSuccess={history.push('/')}
                onFailure={gFailure}
                cookiePolicy="single_host_origin"
                />
            </div>
        </div>
    </div>
    )
}    

export default Header;
